import PcItems from '../../PcItems/PcItems';



//manage state here

class PcCategory extends Component {


    render () {
        let x = Object.keys(this.props.data).map(item => {
            return <PcItems category={item}/>
        })

        return (

            <div>
                <h2>Shop By Category</h2>
                <div>
                    {x}
                </div>
            </div>

        )
    }
}

export default PcCategory;
